Defendant Kimberly E Condoleo in court with attorney Roger C. Pyzyk.  Kevin Michael Osborne appeared for the State of Wisconsin.  Defendant enters a guilty plea to Count 1 and 3.  Court finds defendant guilty.  Count #2 is dismissed by operation of law.  The defendant was sentenced to the following:

Count #1:

HUBER:  45 days, w/Standard Release Conditions including childcare and treatment (Credit - 9 Days). Defendant to report to Huber facility by 5:00 p.m. on 12/26/15.

FINE: $1179.00 (apply cash bail);

DNA SURCHARGE:  $200.00, apply cash bail.
Defendant to provide DNA sample, if not yet provided,   immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

D/L REVOCATION: 14 months;

IGNITION INTERLOCK: 14 months;

Attendance at a Victim Impact Panel on:  completed on 12/10/15.

DAY REPORT CENTER: 6 MONTHS consecutive to Huber Sentence. Good time not allowed on Day Report Center.

Other:  AODA ASSESSMENT AND FOLLOW THROUGH.

Count #3
  The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

6 MONTHS JAIL consecutive to Count #1 if revoked or any other sentence;

TERM OF PROBATION:  1 YEARS;

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain full time employment and/or combination of schooling.
*Terms of any contact with Mark H. as the agent deems appropriatet;
*DNA sample to be provided if not yet previously done.
*Perform 50 hours community service. 
*Provide DNA Sample. 

COURT COSTS:  $243.00 (apply cash bail and balance to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);

CONDITION TIME: 60 DAYS, STAYED; to be used at agent's discretion.  Agent to determine with or without non working hours.
